	"iService_UI5/view/user.view.xml":'<mvc:View xmlns:mvc="sap.ui.core.mvc"\n\txmlns="sap.m"\n\txmlns:l="sap.ui.layout"\n\tcontrollerName="iService_UI5.controller.user"><Page title="iServices"\n\t\tclass="sapUiContentPadding"\n\t\tenableScrolling="true"\n\t\tshowHeader="false"><content><Panel><Label text="{i18n>mandatoryFields}" /><l:VerticalLayout id="Userdaten" /><HBox id="buttonsHBox"\n\t\t\t\t\tfitContainer="true"><Button text="{i18n>edit}"\n\t\t\t\t\t\tid="aendernButton"\n\t\t\t\t\t\tpress="changeData"\n\t\t\t\t\t\ticon="sap-icon://edit"\n\t\t\t\t\t\tvisible="true"><layoutData><FlexItemData growFactor="0.05" /></layoutData></Button><Button text="{i18n>save}"\n\t\t\t\t\t\tid="sichernButton"\n\t\t\t\t\t\ticon="sap-icon://save"\n\t\t\t\t\t\ttype="Accept"\n\t\t\t\t\t\tpress="saveData"\n\t\t\t\t\t\tvisible="{= ${/STATUS} === \'aktiv\'}"><layoutData><FlexItemData growFactor="0.05" /></layoutData></Button><Button text="{i18n>cancel}"\n\t\t\t\t\t\tid="abbrechenButton"\n\t\t\t\t\t\ticon="sap-icon://decline"\n\t\t\t\t\t\tpress="cancelChanges"\n\t\t\t\t\t\tvisible="false"><layoutData><FlexItemData growFactor="0.05" /></layoutData></Button><Button text="{i18n>delete}"\n\t\t\t\t\t\tid="loeschenButton"\n\t\t\t\t\t\ticon="sap-icon://delete"\n\t\t\t\t\t\tpress="deleteData"\n\t\t\t\t\t\ttype="Reject"\n\t\t\t\t\t\tvisible="{= ${/STATUS} === \'aktiv\'}"><layoutData><FlexItemData growFactor="0.05" /></layoutData></Button><Button text="{i18n>restore}"\n\t\t\t\t\t\tid="wiedererstellenButton"\n\t\t\t\t\t\ticon="sap-icon://synchronize"\n\t\t\t\t\t\tpress="reviveData"\n\t\t\t\t\t\ttype="Ghost"\n\t\t\t\t\t\tvisible="{= ${/STATUS} === \'gelÃ¶scht\'}"><layoutData><FlexItemData growFactor="0.05" /></layoutData></Button><Button text="{i18n>activate}"\n\t\t\t\t\t\tid="aktivierenButton"\n\t\t\t\t\t\ticon="sap-icon://activate"\n\t\t\t\t\t\tpress="activateData"\n\t\t\t\t\t\ttype="Emphasized"\n\t\t\t\t\t\tvisible="{= ${/STATUS} === \'im Anschluss\'}"><layoutData><FlexItemData growFactor="0.05" /></layoutData></Button><Button text="{i18n>resetPassword}"\n\t\t\t\t\t\tid="passwordResetButton"\n\t\t\t\t\t\ttype="Ghost"\n\t\t\t\t\t\tpress="resetPasswort"\n\t\t\t\t\t\ticon="sap-icon://synchronize"\n\t\t\t\t\t\tvisible="{= ${/STATUS} === \'aktiv\'}"><layoutData><FlexItemData growFactor="0.05" /></layoutData></Button></HBox></Panel></content></Page></mvc:View>'
